import React from 'react';

interface NavItem {
  name: string;
  href: string;
}

interface NavLinksProps {
  navItems: NavItem[];
  className?: string;
  className2?: string;
}

const NavLinks: React.FC<NavLinksProps> = ({ navItems, className,className2, ...props }) => {
  return (
    <ul className={`${className}`} {...props}>
      {navItems.map((item, index) => (
        <li key={index} className={`${className2}`}>
          <a href={item.href}>{item.name}</a>
        </li>
      ))}
    </ul>
  );
};

export default NavLinks;
